import{_ as t,c as d,o as r,a}from"./app.9a9f499d.js";const g=JSON.parse('{"title":"凹语言启动首轮贡献者回馈","description":"","frontmatter":{},"headers":[],"relativePath":"smalltalk/st0078.md"}'),e={name:"smalltalk/st0078.md"},l=a('<h1 id="凹语言启动首轮贡献者回馈" tabindex="-1">凹语言启动首轮贡献者回馈 <a class="header-anchor" href="#凹语言启动首轮贡献者回馈" aria-hidden="true">#</a></h1><ul><li>时间：2025-05-04</li><li>撰稿：武汉市凹语言科技有限公司</li><li>转载请注明原文链接：<a href="https://wa-lang.org/smalltalk/st0078.html" target="_blank" rel="noreferrer">https://wa-lang.org/smalltalk/st0078.html</a></li></ul><hr><p>凹语言于2024年底申报“武汉市优秀开源软件项目”并成功入选，获武汉市2024年软件产业发展专项资金支持，奖励金额：￥300000（叁拾万元整）。凹语言项目所取得的成果离不开广大贡献者的参与，经公司决议，拟拿出部分奖金，按 ￥1 / 3贡献点 的比例发放给各位贡献者，以感谢大家的付出。本轮发放总金额超10w，详细清单如下：</p><table><thead><tr><th>贡献者</th><th>贡献点</th><th>金额（￥）</th></tr></thead><tbody><tr><td>柴树杉</td><td>86000</td><td>28666</td></tr><tr><td>丁尔男</td><td>90500</td><td>30166</td></tr><tr><td>史斌</td><td>29000</td><td>9666</td></tr><tr><td>扈梦明</td><td>49000</td><td>16333</td></tr><tr><td>赵普明</td><td>18000</td><td>6000</td></tr><tr><td>宋汝阳</td><td>2000</td><td>666</td></tr><tr><td>刘云峰</td><td>1000</td><td>333</td></tr><tr><td>王潇南</td><td>1000</td><td>333</td></tr><tr><td>王泽龙</td><td>1000</td><td>333</td></tr><tr><td>吴烜</td><td>3000</td><td>1000</td></tr><tr><td>刘斌</td><td>2500</td><td>833</td></tr><tr><td>尹贻浩</td><td>2000</td><td>666</td></tr><tr><td>安博超</td><td>3000</td><td>1000</td></tr><tr><td>yuqiaoyu</td><td>600</td><td>200</td></tr><tr><td>qstesiro</td><td>200</td><td>66</td></tr><tr><td>small_broken_gong</td><td>100</td><td>33</td></tr><tr><td>tk103331</td><td>100</td><td>33</td></tr><tr><td>蔡兴</td><td>3000</td><td>1000</td></tr><tr><td>王任义</td><td>1000</td><td>333</td></tr><tr><td>imalasong</td><td>1000</td><td>333</td></tr><tr><td>杨刚</td><td>4000</td><td>1333</td></tr><tr><td>崔爽</td><td>2000</td><td>666</td></tr><tr><td>李瑾</td><td>10000</td><td>3333</td></tr></tbody></table><p>我们相信，各位参与开源项目的初衷是发自内心的、非功利的热爱，但当凹语言项目切实取得了收益时，我们认为自己有义务与社区的贡献者分享。虽然发放的金额不高，但我们希望藉由本次活动践行“<strong>开源项目应与贡献者共建共荣</strong>”的理念。在接下来的一个月之内，将陆续展开贡献者信息登记确认、资金发放等工作，请贡献者关注并相互转告。</p><p>由于缺乏参考案例，本轮回馈的具体操作过程可能存在不尽如人意之处，希望大家予以海涵。若您有财税经验，对合规性有建设性的意见，非常欢迎您与我们联系！</p>',7),s=[l];function o(n,_,h,i,c,p){return r(),d("div",null,s)}const f=t(e,[["render",o]]);export{g as __pageData,f as default};
